import React from 'react'; 
import "./Navbar.css"; 
import { Link } from 'react-scroll';

const Navbar = props => {
 return (
  <nav className="navbar">
    <ul>
      <li>
        <Link to="about">
          About
        </Link>
      </li>
      <li>
        <Link to="projects">
          Projects
        </Link>
      </li>
    </ul>
  </nav>
 );
} 

export default Navbar;
